// SPDX-License-Identifier: MIT
pragma solidity ^0.8.21;

contract VMTReward {

    struct User {
        uint256 userID;
        uint256 plantsPlanted;
        uint256 tokensRewarded;
    }

    mapping(uint256 => User) public users;
    uint256 public totalUsers;

    event TokensRedeemed(uint256 userID, uint256 tokensRedeemed, uint256 saplingsRedeemed);

    // Function to reward users based on their rank
    function rewardUsers(uint256[] memory userIDs, uint256[] memory ranks) public {
        require(userIDs.length == ranks.length, "Mismatch in the length of user IDs and ranks");

        for (uint256 i = 0; i < userIDs.length; i++) {
            uint256 userID = userIDs[i];
            uint256 rank = ranks[i];
            
            uint256 rewardTokens = calculateRewardTokens(rank);
            users[userID] = User({
                userID: userID,
                plantsPlanted: 0, // Initially set to 0, to be updated by the user when they plant trees
                tokensRewarded: rewardTokens
            });
        }
    }

    // Function to calculate reward tokens based on rank
    function calculateRewardTokens(uint256 rank) private pure returns (uint256) {
        if (rank >= 1 && rank <= 10) {
            return 1000 - (rank - 1) * 50;  // First 10 ranks get decreasing rewards
        } else if (rank >= 11 && rank <= 50) {
            return 500;  // Ranks from 11th to 50th get 500 tokens
        }
        return 0;
    }

    // Function to set the number of plants planted for a user (to be called by the user or admin)
    function setPlantsPlanted(uint256 userID, uint256 plantsPlanted) public {
        require(users[userID].userID != 0, "User does not exist");
        users[userID].plantsPlanted = plantsPlanted;
    }

    // Function to redeem tokens
    function redeemTokens(uint256 userID, uint256 tokensToRedeem) public returns (uint256 saplingsRedeemed) {
        require(users[userID].userID != 0, "User does not exist");
        require(users[userID].plantsPlanted == 1000, "User is not eligible for redemption");

        uint256 availableTokens = users[userID].tokensRewarded;
        require(tokensToRedeem <= availableTokens, "Insufficient tokens");

        // Redeem tokens, 1 sapling for every 10 tokens
        saplingsRedeemed = tokensToRedeem / 10;

        // Update the user's redeemed tokens
        users[userID].tokensRewarded -= tokensToRedeem;

        emit TokensRedeemed(userID, tokensToRedeem, saplingsRedeemed);
    }

    // Function to get the remaining tokens of a user
    function getRemainingTokens(uint256 userID) public view returns (uint256) {
        require(users[userID].userID != 0, "User does not exist");
        return users[userID].tokensRewarded;
    }

    // Function to check if a user is eligible for redemption
    function checkEligibility(uint256 userID) public view returns (bool) {
        require(users[userID].userID != 0, "User does not exist");
        return users[userID].plantsPlanted == 1000;
    }

}
